gitlab2prov94868d5e-ba60-5d2d-bdda-3b61b.gitlab2provevent_content:
I knew I wouldn't be able to get away with not completing the query :P I was itching to do it myself, to be honest.

I am also quite rusty with my SPARQL, but have been taking notes as I learn. Here's what I managed to come up with:

```swift
SELECT ?mainUrl ?otherUrls WHERE {
  {
    # wdt picks up only the preferred rank statement(s)
    wd:Q21980377 wdt:P856 ?mainUrl.
  }
  UNION
  {
    wd:Q21980377 p:P856 ?urlProp.
    ?urlProp wikibase:rank wikibase:NormalRank.
    ?urlProp ps:P856 ?otherUrls.
  }
}
```

or, to use a more compact syntax:

```swift
SELECT ?mainUrl ?otherUrls WHERE {
  { wd:Q21980377 wdt:P856 ?mainUrl. }
  UNION
  { wd:Q21980377 p:P856 [wikibase:rank wikibase:NormalRank; ps:P856 ?otherUrls]. }
}
```

Here's the resulting json query URL: https://query.wikidata.org/sparql?format=json&query=SELECT%20%3FmainUrl%20%3FotherUrls%20WHERE%20%7B%0A%20%20%7B%20wd%3AQ21980377%20wdt%3AP856%20%3FmainUrl.%20%7D%0A%20%20UNION%0A%20%20%7B%20wd%3AQ21980377%20p%3AP856%20%5Bwikibase%3Arank%20wikibase%3ANormalRank%3B%20ps%3AP856%20%3FotherUrls%5D.%20%7D%0A%7D

Hopefully that's usable?

And yeah, I found out about this via reddit :) I loved that it was built on top of Wikidata! I hope more of these experiments keep popping up.

gitlab2prov5ac424ff-5ee2-57da-be78-1b004.gitlab2provissue_description:
Rather than getting the entire set of claims for the Wikidata entity for Sci-hub via `action=wbgetentities&props=claim`, and then filtering out the unnecessary content, it would be nicer to fetch explicitly the required data.

After some experimentation, I found that the following query might provide the intended information:

```swift
SELECT ?mainUrl ?otherUrls WHERE {
  { wd:Q21980377 wdt:P856 ?mainUrl. }
  UNION
  { wd:Q21980377 p:P856 [ ps:P856 ?otherUrls ]. }
}
```

If you input [this query in the visual query helper](https://query.wikidata.org/#SELECT%20%3FmainUrl%20%3FotherUrls%20WHERE%20%7B%0A%20%20%7B%20wd%3AQ21980377%20wdt%3AP856%20%3FmainUrl.%20%7D%0A%20%20UNION%0A%20%20%7B%20wd%3AQ21980377%20p%3AP856%20%5B%20ps%3AP856%20%3FotherUrls%20%5D.%20%7D%0A%7D), you can then click the `</> Code` link above the results table (after you press the play button) which will provide a bunch of ways to access the data programmatically, including the [full URL to get the result as a json object](https://query.wikidata.org/sparql?format=json&query=SELECT%20?mainUrl%20?otherUrls%20WHERE%20{%20{%20wd:Q21980377%20wdt:P856%20?mainUrl.%20}%20UNION%20{%20wd:Q21980377%20p:P856%20[%20ps:P856%20?otherUrls%20].%20}%20}), and even sample JavaScript code to use it!

Note that this query doesn't filter out deprecated rank statements; I'd have to experiment some more with it to include that, but [these examples](https://www.wikidata.org/wiki/Wikidata:SPARQL_query_service/queries/examples) should be useful in case anyone can get to it in the meantime.
